script: |
  super -f text -I q1186.spq | sort > q1186.out

inputs:
  - name: q1186.spq
    data: |
      SELECT DISTINCT - col1 * + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 NOT IN ( - col2 * - + 27 / - 24, col0 - - + col2 * + col0, 9 + + + 42 );
  - name: tab1

outputs:
  - name: q1186.out
    data: |
